import mealsimage from "../../Assests/Meal.jpg";
import classes from "./Header.module.css"
const Header = () => {
  return (
    <Fragment>
      <header className={classes.header}>
        <h3>Shivam Meal</h3>
        <button>cart</button>
      </header>
      <div className={classes}>
        <img src={mealsimage}></img>
      </div>
    </Fragment>
  );
};
export default Header;
